description:
Categoria: Not For Profit
Retribuzione: 60000-62000€
Luogo di lavoro: Milano
Il candidato prescelto dovrà occuparsi della definizione e dell'implementazione della strategia di comunicazione.


		Definizione ed implementazione della strategia di comunicazione;

		Gestione piano annuale e budget;

		Gestione, motivazione e sviluppo del team di lavoro dedicato;

		Spokeperson per SOS Villaggi dei Bambini qualora necessario;

		Supporto a Presidenza e Direzione nella gestione di interventi esterni e di relazioni con i media;

		Responsabilità attività ufficio stampa, testimonials ed eventi;

		Definizione di linee guida e tool kit di comunicazione per i Villaggi SOS appartenenti al network dell'organizzazione;

		Sviluppo di materiali istituzionali e di raccolta fondi;

		Supporto al lavoro di "advocacy" gestito da team paralleli (es. eventi, positions papers, etc);

		Responsabilità attività "digital communications" (incl gestione sito web);

		Gestione e supervisione delle attività di "crisis communications";

		Sviluppo e gestione di gruppi locali di volontariato in ottica di Brand Awareness e Fundraising;

		Partecipazione a network internazionali (SOS Children's Villages International Ecomms Group) e nazionali (es AGIRE);

		Gestione agenzie comunicazione;

		Gestione progetti e/o campagne trasversali.


Requisiti: Comprovata esperienza nel mondo no profit;Ottime doti creative e di problem solving;Capacità di definire ed implementare una strategia di comunicazione esterna utilizzando budget mirati;Eccellente conoscenza delle metodologie di comunicazione legate al tema no profit;Buone capacità di mantenere e gestire le relazioni con partner esterni;Ottima capacità di lavorare in sinergia con altri team di lavoro e con un gruppo allargato internazionale;Esperienza nella gestione di progetti complessi;Sensibilità e approccio comunicativo in linea al posizionamento del Brand;Esperienza presenza media;La conoscenza di rilevanti contatti all'interno di editori strategici costituirà elemento distintivo;Ottima conoscenza lingua inglese.Michael Page International Italia srl, società autorizzata dal Ministero del Lavoro all'esercizio dell'attività di ricerca e selezione del personale, di cui all’art. 2, c. 1 lett. c) del  D.Lgs 276/03, con protocollo nr. 20711 del 28/12/2006. I candidati ambosessi (L.903/77) sono invitati a leggere sul sito www.michaelpage.it l'informativa sulla Privacy (art. 13 D.Lgs.196/2003).  





